(1365, 'About Extras', '2020-07-12 12:23:57'),
(1366, 'Extras are a great way to apply charges to invoices that are re-occuring or date sensitive.\r\n            For all other charges, we recommend adding them directly to the invoice.', '2020-07-12 12:23:57'),
(1367, 'Extras have two types', '2020-07-12 12:23:57'),
(1368, 'items and rentals. They differ in the way they apply charges to invoices.', '2020-07-12 12:23:57'),
(1369, 'Rentals, such extra beds, are charged the same way rooms are charged -- by night.\r\n            They are charged based on the number of nights between the start and end date.\r\n            For example, if the start date is 2012-06-20 and the end date 2012-0', '2020-07-12 12:23:57'),
(1370, 'Items, such as tickets and food, are charged by day.\r\n            They are charged based on the number of days that include the start and end date.\r\n            For example, if the start date is 2012-06-20 and the end date 2012-06-22, the invoice will be ', '2020-07-12 12:23:57'),
(1371, 'Extras also have different', '2020-07-12 12:23:57'),
(1372, 'charging schemes.', '2020-07-12 12:23:57'),
(1373, 'These are used to choose when and how you charge extras.', '2020-07-12 12:23:57'),
(1374, 'Selecting \'on start date\' charges the rate to the invoice only once on the the start date,\r\n            but allows you to record the start and end date that the extra applies to.\r\n            This can be useful for charging upfront fees or deposits for a ', '2020-07-12 12:23:57'),
(1375, 'Selecting \'once a day\' charges the rate on a re-occuring basis.\r\n            Reoccuring charges operate as described in the rental and item descriptions above.', '2020-07-12 12:23:57'),
(1376, 'Extra Name', '2020-07-12 12:23:57'),
